/**
 * 
 *Starts the GUI for Ascension
 *
 * @author heshelhj.
 *         Created Apr 22, 2016.
 */

public class MainGUI {
	
	private static final int WIDTH = 1220;
	private static final int HEIGHT = 900;

	public static void main(String[] args) {
		Player player1 = Player.makePlayer();
		Board board = new Board();
		player1.addRunes(0);
		GameBoard ascension = new GameBoard(player1, board);
		JFrame frame = new JFrame("ASCENSION");
		frame.setSize(WIDTH, HEIGHT);
		
		ascension.addMouseListener(new CardListener(player1, ascension.playerList, ascension.centerList, board));
		
		frame.add(ascension, BorderLayout.CENTER);
		
		ascension.repaint();
		
		frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);
		frame.setVisible(true);
	}
}

package devops.hw1.core;

import java.awt.image.BufferedImage;
import java.util.HashMap;

public class HeroCard extends ACard {
	
	public HeroCard(){
		this.cost = 0;
	}
	
	public HeroCard(int i){
		this.cost = i;
	}

	/**
	 * Constructs a hero card that has the given information.
	 * @param image
	 * @param name
	 * @param faction
	 * @param cost
	 * @param honor
	 * @param rarity
	 * @param effects
	 */
	public HeroCard(BufferedImage image, String name, String faction, int cost,
			int honor, int rarity, HashMap<String, Integer> effects) {
		this.image = image;
		this.name = name;
		this.faction = faction;
		this.cost = cost;
		this.honor = honor;
		this.rarity = rarity;
		this.effects = effects;
	}

}

